import React from "react";
import "../style/project.css";
class Project extends React.Component {
  render() {
    return (
      <section className="section" id="project2">
        <div className="project-container">
          <div className="project-content">
            <h2>Steamind</h2>
            <p>Visualizing data from the popular game service Steam.</p>
            <div
              style={
                ({ top: 0 },
                { left: 0 },
                { position: "absolute" },
                { width: 100 + "%" },
                { height: 100 + "%" })
              }
            >
              <iframe
                // style="position:absolute;top:0;left:0;width:100%;height:100%;"
                style={
                  ({ top: 0 },
                  { left: 0 },
                  { position: "absolute" },
                  { width: 100 + "%" },
                  { height: 100 + "%" })
                }
                title="Video"
                src="https://player.vimeo.com/video/526182623"
                frameBorder="0"
                allow="autoplay; fullscreen; picture-in-picture"
              ></iframe>
            </div>
          </div>
          <div className="project-info">
            <p>Here goes info</p>
          </div>
        </div>
      </section>
    );
  }
}

export default Project;
